import React from 'react'
import TodoList from '../components/TodoList'

function Home() {
  return (
    <div>
        <h1>Dashboard</h1>
        <div>
            <button>Logout</button>
        </div>
        <TodoList
        tasks={[
            {
            name: "todo1",
            subtasks: []
            },
            {
            name: "todo2",
            subtasks: ["subtask1"]
            }
        ]}
        ></TodoList>
    </div>
  )
}

export default Home
